    fetch("http://localhost:4000/api/products")
      .then((res) => res.json())
      .then((data) => setProducts(data));
  }, []);

  return (
    <div>
      <h2>Products</h2>
      {products.map((p) => (
        <div key={p.id}>{p.name} - â‚¹{p.price}</div>
      ))}
    </div>
  );
};

export default ProductsPage;
